OSM.Survey.valCheckS8 = function(event){

    var s8a_num = parseInt(OSM.Survey.S8a.get('answerSet')[OSM.Survey.S8a.getAnswers()].get('objectName').replace('_',''));
    var s8_num = parseInt(event.sourceElement.get('answerSet')[event.sourceElement.getAnswers()].get('objectName').replace('_',''));

    if(s8a_num > s8_num){
        return{
            status: false,
            message: "Code được chọn ở S8 ≥ code được chọn S8a"
        };
    }

    return{
        status: true
    };
}

