OSM.Survey.valCheckQBE = function(event){

    OSM.NotificationSystem.removeAllNotifications();

    var count_code_1 = 0;
    var objLoop = event.sourceElement.parent().parent();

    var iterations = objLoop.get('childNodes');

    iterations.forEach(function(iterator, key){

        if(iterator.get('isVisible')){

            var iterationName = iterator.get('objectName');
            var iteration = objLoop.getIteration(iterationName);

            if(iteration._scale.isAnswerSelected(['_1'])){

                count_code_1++;
            }
        }
    });

    if(count_code_1 > 1){
        return{
            status: false,
            message: "Code 'Nhãn hiệu đầu tiên tôi sẽ chọn' chỉ được chọn cho 1 nhãn hiệu."
        }
    }

    return{
        status: true
    };
};

