    "controller": function (renderShellOnly) {
        if (typeof OSM.Survey.closenessSliderFunctionsTwoSides === "undefined") {
            OSM.Survey.closenessSliderProperties = {};
            OSM.Survey.closenessSliderFunctionsTwoSides = {
                allowMovement: false,
                scaleMin: 0.5,
                scaleMax: 1.5,
                startingPosition: 50,
                currentPercents: 0,
                questionNotSetFromOutHandler: true,
                scrollInterval: null,
                swipeInterval: null,
                isRTL: false,
                version: 180711,

                eventDownHandler: function (surveyID, event) { // press down handler
                    event.preventDefault();
                    var nav = RM.Map.getElementById(surveyID).get("navigator");
                    nav.disableSwipeNavigation();
                    clearInterval(OSM.Survey.closenessSliderFunctionsTwoSides.swipeInterval);
                    OSM.Survey.closenessSliderFunctionsTwoSides.swipeInterval = setTimeout(function () {
                        nav.enableSwipeNavigation();
                    }, 1200);

                    var target = event.target;
                    if (target.tagName.toLowerCase() === "span") {
                        target = target.parentNode;
                    }
                    var idSeparated = target.id.split("_");
                    var slider = $("#sliderHandle_" + idSeparated[1]);
                    var transitionVal = "left 300ms ease-out";
                    if (OSM.Survey.closenessSliderFunctionsTwoSides.isRTL) {
                        transitionVal = "right 300ms ease-out";
                    }
                    switch (idSeparated[0]) {
                        case "sliderHandle": // slide handle
                            OSM.Survey.closenessSliderFunctionsTwoSides.allowMovement = true;
                            transitionVal = "";
                            break;
                        case "sliderZones": // click on rail
                            OSM.Survey.closenessSliderFunctionsTwoSides.allowMovement = false;
                            var sliderWidth = slider[0].offsetWidth;
                            var touchZoneWidth = target.offsetWidth - sliderWidth;
                            var newLeft = event.offsetX;
                            if (RM.OSM.PlatformSpecifics.ontouchstartEventFormat === "ontouchstart") {
                                var clientRect = slider[0].getBoundingClientRect();
                                newLeft = event.touches[0].clientX - (clientRect.left - slider[0].offsetLeft);
                            }
                            var leftPrct = OSM.Survey.closenessSliderFunctionsTwoSides.pixelsToPercentage((newLeft - (sliderWidth / 2)), touchZoneWidth);
                            if (OSM.Survey.closenessSliderFunctionsTwoSides.isRTL) {
                                leftPrct = 100 - leftPrct;
                            }
                            OSM.Survey.closenessSliderFunctionsTwoSides.moveSliderToPosition(slider[0], leftPrct);
                            break;
                        default:
                            console.error("Unknown element:", target);
                            break;
                    }
                    slider.css({
                        '-webkit-transition': transitionVal,
                        '-moz-transition': transitionVal,
                        '-ms-transition': transitionVal,
                        '-o-transition': transitionVal,
                        'transition': transitionVal
                    });
                },

                eventMoveHandler: function (surveyID, event) { // move handler
                    event.preventDefault();
                    if (OSM.Survey.closenessSliderFunctionsTwoSides.allowMovement) {
                        if (OSM.Survey.closenessSliderFunctionsTwoSides.scrollInterval !== null) {
                            clearInterval(OSM.Survey.closenessSliderFunctionsTwoSides.scrollInterval);
                            OSM.Survey.closenessSliderFunctionsTwoSides.scrollInterval = null;
                        }
                        OSM.Survey.closenessSliderFunctionsTwoSides.toggleUtilitiesDuringDrag(surveyID, true);

                        var target = event.target;
                        if (target.tagName.toLowerCase() === "span") {
                            target = target.parentNode;
                        }
                        var sliderID = target.id.split("_")[1];
                        var slider = document.getElementById("sliderHandle_" + sliderID);
                        var clientRect = slider.getBoundingClientRect();
                        var offsetLeft = event.clientX;
                        var safety = 1;
                        if (RM.OSM.PlatformSpecifics.ontouchstartEventFormat === "ontouchstart") {
                            offsetLeft = event.touches[0].clientX;
                            safety = event.touches[0].radiusX;
                        }
                        var railWidth = slider.parentNode.offsetWidth - clientRect.width;
                        var newLeft = Math.round(offsetLeft - (clientRect.left - slider.offsetLeft) - (clientRect.width / 2));
                        if (newLeft >= 0 && newLeft <= railWidth + safety) {
                            var leftPrct = OSM.Survey.closenessSliderFunctionsTwoSides.pixelsToPercentage(newLeft, railWidth);
                            OSM.Survey.closenessSliderFunctionsTwoSides.currentPercents = leftPrct;
                            if (OSM.Survey.closenessSliderFunctionsTwoSides.isRTL) {
                                OSM.Survey.closenessSliderFunctionsTwoSides.moveSliderToPosition(slider, (100 - leftPrct));
                            } else {
                                OSM.Survey.closenessSliderFunctionsTwoSides.moveSliderToPosition(slider, leftPrct);
                            }
                        } else {
                            OSM.Survey.closenessSliderFunctionsTwoSides.allowMovement = false;
                            if (RM.OSM.PlatformSpecifics.ontouchstartEventFormat !== "ontouchstart") {
                                OSM.Survey.closenessSliderFunctionsTwoSides.setOSMQuestionObject(sliderID, OSM.Survey.closenessSliderFunctionsTwoSides.currentPercents);
                            }
                        }

                        OSM.Survey.closenessSliderFunctionsTwoSides.scrollInterval = setTimeout(function () {
                            OSM.Survey.closenessSliderFunctionsTwoSides.toggleUtilitiesDuringDrag(surveyID, false);
                            OSM.Survey.closenessSliderFunctionsTwoSides.scrollInterval = null;
                        }, 1200);
                    }
                },

                eventUpHandler: function (surveyID, event) { // release up handler
                    event.preventDefault();
                    if (OSM.Survey.closenessSliderFunctionsTwoSides.questionNotSetFromOutHandler) {
                        OSM.Survey.closenessSliderFunctionsTwoSides.allowMovement = false;
                        var target = event.target;
                        if (target.tagName.toLowerCase() === "span") {
                            target = target.parentNode;
                        }
                        OSM.Survey.closenessSliderFunctionsTwoSides.setOSMQuestionObject(target.id.split("_")[1], OSM.Survey.closenessSliderFunctionsTwoSides.currentPercents);
                    } else {
                        OSM.Survey.closenessSliderFunctionsTwoSides.questionNotSetFromOutHandler = true;
                    }
                },

                eventOutHandler: function (surveyID, event) { // if mouse goes out of the slider container stop interaction
                    event.preventDefault();
                    var id = event.target.id;
                    if (id.match("sliderZones") && OSM.Survey.closenessSliderFunctionsTwoSides.allowMovement) {
                        OSM.Survey.closenessSliderFunctionsTwoSides.allowMovement = false;
                        OSM.Survey.closenessSliderFunctionsTwoSides.setOSMQuestionObject(id.split("_")[1], OSM.Survey.closenessSliderFunctionsTwoSides.currentPercents);
                        OSM.Survey.closenessSliderFunctionsTwoSides.questionNotSetFromOutHandler = false;
                    }
                },

                moveSliderToPosition: function (slider, percentage) { // move slider to specific position and set scale of heart image
                    percentage = parseFloat(percentage.toFixed(3));
                    var heartElem = slider.children[0];
                    var scaleSize = OSM.Survey.closenessSliderFunctionsTwoSides.getScaleSize(percentage);
                    var compensation = 5 * percentage / 100;
                    $(heartElem).css({
                        '-webkit-transform': 'scale(' + scaleSize + ')',
                        '-moz-transform': 'scale(' + scaleSize + ')',
                        '-ms-transform': 'scale(' + scaleSize + ')',
                        '-o-transform': 'scale(' + scaleSize + ')',
                        'transform': 'scale(' + scaleSize + ')'
                    });
                    if (OSM.Survey.closenessSliderFunctionsTwoSides.isRTL) {
                        slider.style.right = (percentage - compensation) + "%";
                    } else {
                        slider.style.left = (percentage - compensation) + "%";
                    }
                    OSM.Survey.closenessSliderFunctionsTwoSides.currentPercents = percentage;
                },

                setOSMQuestionObject: function (questionID, percents) { // executes setAnswers and setComment
                    var question = RM.Map.getElementById(questionID);
                    var answerPos = Math.floor(percents / 10);
                    if (answerPos > 9) {
                        answerPos = 9;
                    }
                    // console.info(percents, answerPos);
                    var answer = OSM.Survey.closenessSliderProperties[questionID][answerPos].value;
                    question.setAnswers(answer, RM.Utils.eventOriginType.User);
                    question.setComment(percents, RM.Utils.eventOriginType.User);
                },

                getScaleSize: function (percentage) { // returns the scale of the scale image by a given position
                    var scaleMin = OSM.Survey.closenessSliderFunctionsTwoSides.scaleMin;
                    var scaleMax = OSM.Survey.closenessSliderFunctionsTwoSides.scaleMax;
                    return (scaleMin + (((scaleMax - scaleMin) * OSM.Survey.closenessSliderFunctionsTwoSides.startingPosition) / 100)).toFixed(2);
                },

                percentageToPixels: function (percent, width) { // turns percents to pixels
                    if (percent < 0) {
                        percent = 0;
                    }
                    if (percent > 100) {
                        percent = 100;
                    }
                    return Math.round((percent * width) / 100);
                },

                pixelsToPercentage: function (offset, width) { // turns puxels to percents
                    if (offset < 0) {
                        offset = 0;
                    }
                    if (offset > width) {
                        offset = width;
                    }
                    return parseFloat(((offset / width) * 100).toFixed(3));
                },

                toggleUtilitiesDuringDrag: function (surveyID, disable) { // enables and disables scroll and swipe
                    // var nav = RM.Map.getElementById(surveyID).get("navigator");
                    var scroll = RM.OSM.Renderers.getSlideScroll(surveyID);
                    if (disable) {
                        // nav.disableSwipeNavigation();
                        if (scroll.enabled) {
                            // console.info("scroll.disable");
                            scroll.disable();
                        }
                        // RM.OSM.Renderers.disableSlideScroll(surveyID);
                    } else {
                        // nav.enableSwipeNavigation();
                        // console.info("scroll.enable");
                        scroll.enable();
                        // var scroll = RM.OSM.Renderers.getSlideScroll(surveyID);
                        // RM.OSM.Renderers.handleSlideScrolql(scroll, true, true);
                    }
                },

                getImages: function (question) { // returns all images for the slider, if they are not set, the function returns the default images
                    var imageResources = {
                        "heartImage": "data:image/png;base64,",
                        "userImage": "data:image/png;base64,",
                        "brandImage": "data:image/png;base64,"
                    };
                    var resourcesManager = question.getTop().getResourcesManager();
                    var guid = "";
                    var resource;
                    for (var key in imageResources) {
                        guid = question.get("extendedProperties").get(key);
                        if (guid) {
                            resource = resourcesManager.getResource(guid.replace(/\s|{|}/gi, ""));
                            if (resource) {
                                imageResources[key] = RM.OSM.PlatformSpecifics.getResourceSource(resource);
                            }
                        }
                    }
                    return imageResources;
                },

                getStartingPosition: function (question) { // checks if there is a set answer or comment (if both are set, the comment has the advantage) and returns that value (calculated in percents) as a starting position, else it returns the default starting position
                    var percents = OSM.Survey.closenessSliderFunctionsTwoSides.startingPosition;
                    var answer = question.getAnswers();
                    var comment = question.getComment();
                    if (answer !== "") {
                        var position = question[answer].get("position");
                        // var answer = OSM.Survey.closenessSliderProperties[questionID][answerPos].value;
                        percents = (position * 10) - 5;
                        percents = percents - (5 * percents / 100);
                    }
                    if (comment !== "") {
                        percents = parseFloat(comment);
                        percents = percents - (5 * percents / 100);
                    }
                    return percents;
                }
            };
        }

        var survey = this.getTop();
        var questionID = this.get("uniqueID");
        var renderShell = (renderShellOnly ? true : !survey.get("jitRenderingEnabled"));
        if (RM && RM.OSM && RM.OSM.Builder && RM.OSM.Builder.SurveyDesignView) {
            this.clearAnswers();
        }
        if (renderShell) {
            var onEventHandler = function (event) {
                switch (event.property.name) {
                    case "isVisible": // handler for hide/show
                        RM.OSM.Renderers.handleQuestionVisibility(event);
                        break;
                    case "isChecked": // handler for setAnswers (e careful here, loss of data is possible)
                        if (event.property.currentValue && event.origin !== RM.Utils.eventOriginType.User && event.origin !== RM.Utils.eventOriginType.RollBack) {
                            var position = event.target.get("position");
                            var percents = (position * 10) - 5;
                            event.sourceElement.setComment(percents, RM.Utils.eventOriginType.User);
                            var slider = document.getElementById("sliderHandle_" + event.sourceElement.get("uniqueID"));
                            if (slider) {
                                OSM.Survey.closenessSliderFunctionsTwoSides.moveSliderToPosition(slider, percents);
                            }
                        }
                        break;
                    case "value": // handler for setComment
                        var question = event.sourceElement;
                        if (event.property.currentValue !== "") {
                            var questionID = question.get("uniqueID");
                            var percents = parseFloat(event.property.currentValue);
                            var answerPos = Math.floor(percents / 10);
                            if (answerPos > 9) {
                                answerPos = 9;
                            }
                            if (OSM.Survey.closenessSliderProperties[questionID]) {
                                var answer = OSM.Survey.closenessSliderProperties[questionID][answerPos].value;
                                question.setAnswers(answer, RM.Utils.eventOriginType.User);
                            }
                            var slider = document.getElementById("sliderHandle_" + questionID);
                            if (slider) {
                                OSM.Survey.closenessSliderFunctionsTwoSides.moveSliderToPosition(slider, percents);
                            }
                        }
                        break;
                    case "":
                    case "isCompleted":
                    case "isDisplayed":
                        break;
                    default:
                        console.error("Unknown event:", event.property.name, ", check Closeness slider template!");
                        break;
                }
            };
            this.removeEventListener('onEvent', onEventHandler);
            this.addEventListener('onEvent', onEventHandler, OSM.Events.eventHandlers.types.visualization);
            this.__onEventHandler__ = onEventHandler;

            var onLanguageChange = function (event) { // handler for language change
                if (event.property.name === "currentLanguageAndLocale") {
                    var currLang = event.property.currentValue;
                    var allLangs = event.target.get("languages");
                    OSM.Survey.closenessSliderFunctionsTwoSides.isRTL = (allLangs && allLangs[currLang] && allLangs[currLang].rtl ? true : false);
                    var renderedSliders = document.querySelectorAll(".customDevClass_closenessSlider_handle");
                    var numOfSliders = renderedSliders.length;
                    if (numOfSliders > 0) {
                        for (var i = 0; i < numOfSliders; i++) {
                            renderedSliders[i].style.left = "";
                            renderedSliders[i].style.right = "";
                            OSM.Survey.closenessSliderFunctionsTwoSides.moveSliderToPosition(renderedSliders[i], OSM.Survey.closenessSliderFunctionsTwoSides.currentPercents);
                        }
                    }
                }
            };
            survey.removeEventListener("onEvent", onLanguageChange);
            survey.addEventListener("onEvent", onLanguageChange, OSM.Events.eventHandlers.types.visualization);
            this.__onLanguageChange__ = onLanguageChange;
        }
    },
    "model": function (renderShellOnly) {
        var survey = this.getTop();
        var templateEngine = RM.OSM.Renderers.TemplateEngine;
        var model = {};
        var uniqueID = this.get("uniqueID");
        var jitRenderingProperties = RM.OSM.JITRenderingUtils.getJITRenderingProperties.call(this, renderShellOnly);
        var slideClass = RM.OSM.Renderers.getSurveyElementClassName.call(this, "ClosenessSlider");
        var isCorrectSetup = true;
        var errorMessage = "";
        var comment = this.get("comment");
        var answerSet = this.get("answerSet");
        var startingPercent = OSM.Survey.closenessSliderFunctionsTwoSides.getStartingPosition(this);
        var scaleSize = OSM.Survey.closenessSliderFunctionsTwoSides.getScaleSize(startingPercent);
        var defaultStartingScale = "-webkit-transform: scale(" + scaleSize + "); -moz-transform: scale(" + scaleSize + "); -ms-transform: scale(" + scaleSize + "); -o-transform: scale(" + scaleSize + "); transform: scale(" + scaleSize + ");";
        var images = OSM.Survey.closenessSliderFunctionsTwoSides.getImages(this);
        var currLang = survey.get("currentLanguageAndLocale");
        var allLangs = survey.get("languages");
        OSM.Survey.closenessSliderFunctionsTwoSides.isRTL = (allLangs && allLangs[currLang] && allLangs[currLang].rtl ? true : false);

        if (!answerSet || !comment) { // check if question (this) is a generic question
            isCorrectSetup = false;
            errorMessage = "The Coleseness slider uses a GENERIC question as a base! It must have an answerSet and a comment!";
        }

        if (!isCorrectSetup) {
            return {
                "uniqueID": uniqueID,
                "renderShell": jitRenderingProperties["renderShell"],
                "renderContent": jitRenderingProperties["renderContent"],
                "slideClass": slideClass,
                "isCorrectSetup": isCorrectSetup,
                "errorMessage": errorMessage
            };
        }

        var dataType = comment.get("dataType"); // check comment settings
        if (comment.get("type") === 2 && dataType.get("length") >= 5 && dataType.get("scale") >= 3) {
            model["comment"] = {
                "uniqueID": comment.get("uniqueID"),
                "commentLabel": templateEngine.prepareElementForRender.call(comment.get("label")),
                "userImage": images.userImage,
                "heartImage": images.heartImage
            };
        } else {
            isCorrectSetup = false;
            errorMessage = "The Data type of the comment must be set to number with Precision/Length: 5 and Scale: 3!";
        }
        var answers = answerSet.get("answers").filterBy(null, null, function(answ) {
            return ((answ.value.get("text").get("text") !== "") && !answ.value.get("isDisplayAsHeader") && answ.value.get("isVisible") && answ.value.get("isEnabled") && !answ.value.get("readOnly"));
        });
        if (answers.count() >= 5) { // answers count check
            var answersArr = [];
            var ans;
            for (var i = 0; i < answers.count(); i++) {
                ans = answers.getItemAt(i).value;
                answersArr.push({
                    "text": ans.get("text").getText(),
                    "uniqueID": ans.get("uniqueID")
                });
            }
            model["answers"] = answersArr;

            model["brandLeft"] = {
                "text": "g",
                "hasText": true,
                "uniqueID": "",
                "image": images.brandImage
            };
            ans = answers.getItemAt(0);
            if (ans) {
                ans = ans.value;
                model.brandLeft["hasText"] = true;
                model.brandLeft["text"] = templateEngine.prepareElementForRender.call(ans.get("text"));
                model.brandLeft["uniqueID"] = ans.get("uniqueID");
            }

            model["brandRight"] = {
                "text": "g",
                "hasText": true,
                "uniqueID": "",
                "image": images.brandImage
            };
            ans = answers.getItemAt(9);
            if (ans) {
                ans = ans.value;
                model.brandRight["hasText"] = true;
                model.brandRight["text"] = templateEngine.prepareElementForRender.call(ans.get("text"));
                model.brandRight["uniqueID"] = ans.get("uniqueID");
            }
        } else {
            isCorrectSetup = false;
            errorMessage = "The answerSet must contain 5 answers!";
        }

        OSM.Survey.closenessSliderProperties[uniqueID] = answers.getAllItems();

        model["surveyID"] = survey.get("uniqueID");
        model["uniqueID"] = uniqueID;
        model["renderShell"] = jitRenderingProperties["renderShell"];
        model["renderContent"] = jitRenderingProperties["renderContent"];
        model["slideClass"] = slideClass;
        model["isCorrectSetup"] = isCorrectSetup;
        model["errorMessage"] = errorMessage;
        model["text"] = templateEngine.prepareElementForRender.call(this.get("text"));
        model["instructions"] = templateEngine.prepareElementForRender.call(this.get("instructions"), false, true, true);
        model["objectName"] = this.get('objectName');
        model["isVisible"] = this.get('isVisible');
        model["isRequired"] = this.get("validator").get("isRequired");
        model["defaultStartingPosition"] = ((OSM.Survey.closenessSliderFunctionsTwoSides.isRTL ? "right: " : "left: ") + startingPercent + "%;");
        model["defaultStartingScale"] = defaultStartingScale;
        model["events"] = {
            "down": RM.OSM.PlatformSpecifics.ontouchstartEventFormat,
            "up": RM.OSM.PlatformSpecifics.ontouchendEventFormat,
            "move": RM.OSM.PlatformSpecifics.ontouchmoveEventFormat,
            "out": "onmouseout"
        };
        return model;
    },
    "destroy": function () {
        this.removeEventListener('onEvent', this.__onEventHandler__);
        this.getTop().removeEventListener('onEvent', this.__onLanguageChange__);
        delete this.__onEventHandler__;
        delete this.__onLanguageChange__;
        var domElem = document.getElementById("slideLi_" + this.get("uniqueID"));
        if (domElem && domElem.parentNode) {
            domElem.parentNode.removeChild(domElem);
        }
