OSM.Survey.addEventListener("onInit", function(event) {

    var arrDefaultQuestions = ["_Gender","_YearOfBirth","_Age","_AgeGroup","_Quota_City","_Quota_Gender","_Quota_AgeGroup","_Quota_Class","_Quota_LSM","_ProjectName","_PersonalIncome","_Married","Q1a_Text","Q1b_Spon","Phase_Videos","Phase_Digitals","QTPO","QTPOa","UA_1_Infor","P1","P2","P3","P4","P5","P6","_ImpactOfCovid_Infor","CRI1","CRI2","CRI3","Q5a_Text","Video_Infor","S12a","S12b","_QTET23","Phase_Campaigns","U3","Huongdan_2_Infor","Huongdan_3_Infor"];

    OSM.Survey.hideQuestions(arrDefaultQuestions);

    OSM.Survey.initializeQuestionComment(OSM.Survey._ProjectName, "<!--Please set a Project Name-->");

    //--SECTION DISTRICTS 
    OSM.Survey.hideSectionWithQuestions(OSM.Survey._SEC_RESD_ADDRESS, ["_ResAddress","_ResDistricts","_ResDistrictSelected","_ResWards","_ResWardSelected"]);

    if(OSM.Survey.countCategories(OSM.Survey._ResProvinces.getAnswers()) == 0)
    {
        //Set all provinces
        //OSM.Survey.initializeQuestion(OSM.Survey._ResProvinces, OSM.Survey.getArrayNumber(1, 63));

        //Set specific province

