    var objLoop = event.sourceElement.parent().parent();
    var iteration = event.sourceElement.parent();

    switch(objLoop.get('objectName')){
        case 'QI':
            OSM.Survey.initializeQuestion(event.sourceElement, OSM.Survey.unionCategories(OSM.Survey.Q2a.getAnswers(), ['_998']));
            break;
        case 'QI_CFSD':
            var arr_listcats_qi_cfsd = new Array();
            arr_listcats_qi_cfsd = OSM.Survey.intersectionArrListCatsWith(['_204','_501'], OSM.Survey._Q1Q2.getAnswers());

            OSM.Survey.initializeQuestion(event.sourceElement, OSM.Survey.unionCategories(arr_listcats_qi_cfsd, ['_998']));
