OSM.Survey.addEventListenersToElements(['PBP_QD1'], "onEntrance", function(event){

    var iteration = event.sourceElement.parent();
    var iteration_label = event.sourceElement.parent().parent().get('answerSet')[iteration.get('objectName')].get('text').getText();

    OSM.Survey.setInsert("id_label", iteration_label.split('<br/>')[1]);
    OSM.Survey.setInsert("id_image", iteration_label.split('<br/>')[0]);

    if(iteration.get('objectName') == '_2430'){

        if(OSM.Survey.SHELL_RECORDING_CONFIRMATION.isAnswerSelected(['_A1']))
        {
            var recordingNameDefault = 'ID' + OSM.Survey.SHELL_CHAINID.getComment() + "_" + event.sourceElement.parent().parent().get('objectName');

            OSM.Survey.startSilentAudioRecording(recordingNameDefault); 
        } 
    }
});

OSM.Survey.QD_PBP_EXPOSER.addEventListener("onEntrance", function(event){

    var arr_listcatresps = new Array();
    var iterations = OSM.Survey.Phase_Poly_Bonus_Pack.get('childNodes');

    iterations.forEach(function(iterator, key){

        if(iterator.get('isVisible')){

            var iterationName = iterator.get('objectName');
            var iteration = OSM.Survey.Phase_Poly_Bonus_Pack.getIteration(iterationName);

            if(iteration.PBP_QD1.isAnswerSelected(['_1'])){

                arr_listcatresps.push(iterationName);
            }
        }
    });

    if(arr_listcatresps.length == 0){
        OSM.Survey.initializeQuestion(event.sourceElement, ['_0']);
    } else {
        OSM.Survey.initializeQuestion(event.sourceElement, ['_1']);
    }
});

