OSM.Survey.QTPO.addEventListener("onNext", function(event){

    var count = 0;

    var iterations = event.sourceElement.get('childNodes');

    iterations.forEach(function(iterator, key){

        if(iterator.get('isVisible')){

            var iterationName = iterator.get('objectName');
            var iteration = event.sourceElement.getIteration(iterationName);

            if(iteration._scale.isAnswerSelected(['_1'])){
                count++;
            }
        }
    });

    OSM.Survey.QTPOa.hide();

    if(count > 0){

        OSM.Survey.QTPOa.show();
    }
});

